&lt;b&gt;STORY:&lt;/b&gt;Burst City is essentially a feature length punk rock music clip. The film is set in a kind of post-apocalyptic Japan where everyone is a punk, a freak or a brutal cop. There are non-stop riots in the streets, non-stop punk concerts, non-stop gang warfare, non-stop police brutality and non-stop car chases. This film is one hell of a wild ride and it left me feeling spun. The soundtrack is made up entirely of awesome Japanese punk rock and fits the images perfectly.



