&lt;b&gt;STORY: &lt;/b&gt;&quot;Fans of hallucinatory head-movies will enjoy this bizarre sci-fi film from Japanese director Izumiya. Putting his 
experience as a '70s protest-music pioneer to work, Izumiya creates a frightening world where a super-robot poisons 
the air with a deadly psychedelic drug, enslaving the populace under the Scar People in the world of their 
hallucinations. Eventually, their bodies begin to meld and change into a giant blob. Using computer graphics, black-
and-white narrative, and stock footage interpolated in strange and grotesque ways, Izumiya creates an unforgettably 
odd film, in many ways the progenitor of such cult classics as Tetsuo, the Iron Man.&quot;



